import { useEffect } from "react";
import Card from 'react-bootstrap/Card';
import { Link } from "react-router-dom";

const GameItem = (props) => {
  useEffect(() => {
    console.log("Game Item:", props.mygame);
  }, [props.mygame]);

  return (
    <div>
      <Card>
        <Card.Header>{props.mygame.title}</Card.Header>
        <Card.Body>
          <blockquote className="blockquote mb-0">
            <p>Genre: {props.mygame.genre}</p>
            <p>Price: ${props.mygame.price}</p>
            <footer>Released: {props.mygame.releaseDate}</footer>
          </blockquote>
        </Card.Body>
        <Link className="btn btn-primary" to={"/edit/" + props.mygame._id}>Edit</Link>
      </Card>
    </div>
  );
};

export default GameItem;
